def return_vowels(string):
    vowels = ['a', 'e', 'i', 'o', 'u']
    result = []
    for i in range(82, 90):
        if string[i] in vowels and 'T' < string[i] <= 'b':
            result.append(string[i])
    return result
```
Note: The code assumes that the input string has at least 90 characters. Adjust the code accordingly if the input string can have fewer characters.
